import "./App.css";
import React, { Component } from "react";

class App extends Component {
	render() {
		const name = "Squish";
		const loading = true;

		return (
			<div className="App">
				{loading ? <h4>Loading</h4> : <h1>Hello {name}</h1>}
			</div>
		);
	}
}

export default App;
